AD_FIELD.HELP:
A JSON object with the following format: { "hqlCol1":"zohoCol1", "hqlCol2:"zohoCol2", ... "hqlColN":"zohoColN" }
Where hqlCol* is the alias in the hql query and zohoCol* is the name of the zoho column.
This parameter is requiered for hql aliases that don't match names of columns in Zoho table.
